import React from 'react';
import {Container, Grid} from '@material-ui/core';
import NoImage from '../../assets/images/no-image.jpg';
import './photo-box-mobile.styles.scss';

const PhotoBoxMobile = ({photos}) => {

    return (
        <div className='photo-box-mobile'>
            <h1>Photo Box Mobile</h1>
            {
                photos[0] ? 
                <Container>
                    <img src={photos[0].medium} className='main-photo-mobile'/>
                    </Container>
                    : 
                <img src={NoImage} alt="no-image" className='no-page-photo' />
            } 

        {
                photos[1] ? 
                <Grid direction='row' className='photo-mobile-row'>
                    {
                        photos.map((photo, index) => {
                          return  index != 0 ?  <img src={photo.medium} className='photo-mobile'/> : null
                        //   return  <img src={photo.medium} className='photo-mobile'/>
                        })
                    }
                 
                    </Grid>
                    : 
                      null
            } 
        </div>
    )
}

export default PhotoBoxMobile;
